import React, { Component } from "react";
import { Button, Flex, Box } from 'rebass';
import { Card } from "reactstrap";

import Header from '../HeaderComponent';

//import { Box, Flex } from 'rebass'


//Login Page
class Home extends Component 
{
  constructor()
  {
    super();
    this.state={ 
    }
    
  }

  render() 
  {
    return(

    <div>
     


  <Flex
    sx={{
      flexDirection: 'column',
      minHeight: '100vh'
    }}>
    <Box
      sx={{
        display: 'grid',
        flex: 1,
        minHeight: '100vh',
        gridTemplateAreas: [
          '"long-box long-box" "left-box right-box" "wide-box wide-box"',
          '"long-box long-box left-box right-box" "long-box long-box wide-box wide-box"'
        ],
        gridTemplateColumns: [
          'repeat(2, 1fr)',
          'repeat(4, 1fr)'
        ],
        gridTemplateRows: [
          '2fr 1fr 1fr',
          'none'
        ],
        gridGap: 20,
        margin: 20
      }}>
      <Box
        sx={{
          flex: 1,
          gridArea: 'long-box'
        }}>
        Long Box
      </Box>
      <Box
        sx={{
          flex: 1,
          gridArea: 'left-box'
        }}>
        Box Left
      </Box>
      <Box
        sx={{
          flex: 1,
          gridArea: 'right-box'
        }}>
        Box Right
      </Box>
      <Box
        sx={{
          flex: 1,
          gridArea: 'wide-box'
        }}>


      </Box>
    </Box>
  </Flex>
    </div>
    )
}

}

export default Home;
